    const [list,setList] = useState([])
    useEffect(() => {
        const getList = async () => {
            const res = await axios.get('http://geek.itheima.net/v1_0/channels')
            // console.log(res)
            setList(res.data.data.channels)
        }
        getList()
    },[])
    return (
        <div>
            <h1>频道列表</h1>
            <ul>
                {list.map((item) => {
                    <></>
                })}
            </ul>
        </div>
    )
}

